import React from 'react'
function EndGame(props) {
    return (
        <div>

            <Win matched={props.matched}

            />
            : props.gameInSession === true && this.state.matched.length
            <img id="game-over" src="https://lh3.googleusercontent.com/proxy/kn69iPJsNOa8eCyIcUukVU8t5W0fIZXklVKSMBTIsasHkZxBFbuBW7I1ypE_HLg_DmdepnoA3zHwaaRl7K_g0Ok4cHYOuVoA"/>
            }</div>
    )
}

export default EndGame
